export const sorts = {
    cheapestFirst: { fn: (a, b) => a.price - b.price, name: "Сначала дешевые" },
    expensiveFirst: { fn: (a, b) => b.price - a.price, name: "Сначала дорогие" },
    ratedFirst: { fn: (a, b) => b.rate - a.rate, name: "Сначала популярные" },
  };
